import React from "react";
import styles from "./SignInForm.module.css";
function SignInForm() {
    return (
        <div className={styles["sign-in-actions"]}>
            <form action="#">
                <h1>Log In</h1>
                <input
                    type="email"
                    name="email"
                    id="email"
                    placeholder="email"
                />
                <input
                    type="password"
                    name="password"
                    id="password"
                    placeholder="password"
                />
                <button type="submit">Login</button>
            </form>
        </div>
    );
}

export default SignInForm;
